  const groupClicked = () => {
    // navigate(`details/${groupID}`);
    console.log('Clicked');
  }

  return (
    <div>
      { group && 
        <div key={group.id} group={group} onClick={ () => groupClicked(group.id) }>
              <p>{group.name}: {group.location}</p> 
        </div>
      }
    </div>
  );
}

